import React from "react";

const Item = props => {
  return (
    <tbody>
      <tr role="row" className="odd">
        <td className="sorting_1">{props.itemName}</td>
        <td>
          <button type="button" class="btn btn-block btn-danger">
            Danger
          </button>
          {props.deleteItem}
        </td>
      </tr>
    </tbody>
  );
};

export default Item;
